
fn main() {
    let input = "";
    let mut chars = input.chars().collect::<Vec<char>>();

    let mut any_action = true;
    while any_action
    {
        any_action = false;
        for idx in 1..chars.len()
        {
            if (chars[idx-1] as i32 == (chars[idx] as i32)+32) ||
               (chars[idx-1] as i32 == (chars[idx] as i32)-32)
            {
                any_action = true;
                //println!("Removed {}{}", chars[idx-1], chars[idx]);
                chars.remove(idx);
                chars.remove(idx-1);

                break;
            }
        }
    }

    println!("{}", chars.len());
}